import React, { useEffect } from 'react';
import { connect, useDispatch } from 'react-redux';
import mapStoreToProps from '../../redux/mapStoreToProps';
import "./Map.css";


function Map(props) {

  const dispatch = useDispatch();

  let url = `https://www.google.com/maps/embed/v1/view?key=${props.store.key}&center=44.764409,-93.279372&zoom=20&maptype=satellite`;
  let geocode = `https://maps.googleapis.com/maps/api/geocode/json?address=1600+Amphitheatre+Parkway,+Mountain+View,+CA&key=${props.store.key}`;

  useEffect(() => {
    dispatch({
      type: 'GET_KEY',
    });
  }, [dispatch]);

  return (
    <div className="row w-100">
      <iframe
        title="unique title"
        width="100%"
        height="600"
        frameBorder="0"
        src={url}
        allowFullScreen>
      </iframe>
    </div>
  );
}

export default connect(mapStoreToProps)(Map);
